import React from 'react';
import { Link } from 'react-router-dom';
import { Menu, Dropdown } from 'antd';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';
import { logout } from '../../actions/auth';

const Navbar = ({ logout }) => {
  const menu = (
    <Menu>
      <Menu.Item key='0'>
        <Link to="/exercises">Exercise List</Link>
      </Menu.Item>
      <Menu.Item key='1'>
        <Link to="/add-exercise">Add Exercise</Link>
      </Menu.Item>
      <Menu.Item key='2'>
        <Link to="/edit-exercise">Edit Exercise</Link>
      </Menu.Item>
      <Menu.Item key='3'>
        <Link to="/dashboard">Clients</Link>
      </Menu.Item>
      <Menu.Item key='4'>
        <Link to="/add">Add Client</Link>
      </Menu.Item>
    </Menu>
  );
  return (
    <nav className="navbar">
      {/* <ul>
        <li>
          <Link to="/exercises">
            <span>EXERCISE LIST</span>
          </Link>
        </li>
        <li>
          <Link to="/add-exercise">
            <span>ADD EXERCISE</span>
          </Link>
        </li>
        <li>
          <Link to="/dashboard">
            <span>CLIENTS</span>
          </Link>
        </li>
        <li>
          <Link to="/add">
            <span>ADD A CLIENT</span>
          </Link>
        </li>
        <li><Link onClick={ logout } to="/">
          <span>LOGOUT</span>
        </Link>
        </li>
      </ul> */}
      <Dropdown overlay={ menu } trigger={ ['click'] }>
        <Link className="dropdown-link" onClick={ (e) => e.preventDefault() }>Menu</Link>
      </Dropdown>
    </nav>
  );
};
Navbar.propTypes = {
  logout: PropTypes.func.isRequired,
};

export default connect(null, { logout })(Navbar);
